INSERT INTO `article_newbie` VALUES ('7', '6', '76979778', '错过出口倒车?', '重奖“黑飞”举报人、严打净空区违法飞行、火速上线无人机实名登记系统、发布民用机场净空区域图……频发的无人机干扰民航飞行安全事件背后，一系列针对无人机的监管举措，正在紧锣密鼓制定中。\r\n2015年12月29日，中国民航局飞行标准司印发了《轻小无人机运行规定》（试行），因为是部门规章，约束力不足。\r\n多位参与征求意见的专家透露，该法规可能是目前针对无人机监管最全面的规定，不仅对无人机拥有者合法飞行指明了方向，也对无人机生产企业的生产提出新的要求，并对“黑飞”行为的处罚作出了明确规定。\r\n参与征求意见的王勇（化名）表示，该规定目前处于征求意见阶段，一些条文可能还会改动，但大体思路应该不会变动，即从生产到销售，以及拥有者的使用，都将依法可依。\r\n他还分析，由于近期无人机监管形势严峻，各方压力都很大，该“管理规定”可能很快就会出台。\r\n王勇介绍，目前正在征求意见的管理规定明确，今后将在无人机生产过程中，推行适航审定制度。如民用无人驾驶航空器未按规定取得适航证书而飞行，将被责令停止飞行，处以10万元以上50万元以下的罚款。\r\n“达到打击违规、清理乱象、正规秩序的目的”\r\n澎湃新闻注意到，上述“整治方案”部署了明确的工作进度，在宏观思路和具体手段上，都提出了要求，并设定了整治工作需要达到的目标。这为后来一系列具体法规和举措的出台，埋下了伏笔。\r\n按“整治方案”部署的要求，这项工作分抽查摸底、集中整治和总结评估三个阶段。完成时间分别为5月底、7月底前和8月底前。目前进行的无人机实名登记，即属于抽查摸底阶段的工作之一。\r\n在集中整治阶段，将加强无人机数量分布集中地区和“黑飞”高发地，以及首都地区、机场周边、重要设施和敏感地区的违法飞行的监控处置和处罚，“达到打击违规、清理乱象、正规秩序的目的”。\r\n在效果评估阶段，空管委将汇总各地整治情况报告，视情况推广有益做法，研究建立健全无人驾驶航空器长效管理机制的措施。\r\n值得一提的是，“整治方案”还给出了较为细致的实施措施。比如，对本地区无人航空器爱好者的情况，有关部门要持续跟踪，对重点人员要不定期走访，增大巡查力度，形成高压态势。\r\n成都和重庆多位无人机爱好者均表示，近期辖区民警到家里来调查，并做了笔录。重庆一位无人机爱好者称，不久前有人半夜敲门，开门才知是民警来询问近期放飞无人机的情况。\r\n此外，对于重点区域的监控、如何规范运行、无人机企业产品的管理、宣传教育和长效机制的建立方面，“整治方案”都给出了方向性的意见。\r\n无人机从图纸设计到生产结束都要监控之中\r\n“整治方案”是紧急情况下的治标之举，而治本则有赖于建立一套能够规范无人机使用的长效机制：除了已经发布的实名制登记规定，无人机的飞行管理规定也在酝酿中。\r\n王勇介绍，目前正在征求意见的无人驾驶航空器飞行管理规定（下称无人机飞行管理规定），对无人机生产企业和监管部门的工作，提出了更高更细的要求。\r\n无人机飞行管理规定明确，今后将在无人机生产过程中，推行适航审定制度。\r\n适航证由适航部门根据民用航空器产品和零件合格审定规定，对民用航空器颁发的证明其处于安全可用状态的证件。\r\n通俗地说，即在一架无人机从图纸设计到生产结束，整个过程都应该纳入民航局试航司的监控之中，以确保每个步骤可追溯。适航监察员对申请适航证的航空器的适航检查，在航空器是设计、制造、组装或者改装现场进行。\r\n适航审定制度是确保飞机的安全性能的重要保障。目前，只有“有人机”和一些需要在航路上飞行的无人机，进行了适航审定。一般消费机无人机，并没有纳入适航审定。\r\n2016年，《民用无人驾驶航空器系统适航管理要求（暂行）》发布征求意见稿，其中已规定，民用无人驾驶航空器最大起飞重量大于250克的民用无人驾驶航空器需按照特殊类、限制类、标准类的分类方式，申请相应的适航证件。\r\n上述“管理要求”至今尚未出台。专门从事飞行器研发和生产的深圳市莲花百川科技有限公司董事长严劲松告诉澎湃新闻，原因是无人机生产企业意见较大，“突然增加一道工作，都不想被管”，他透露，去年这份管理要求意见稿征求意见阶段，全国只有两家企业表示支持，200多家无人机及时相关企业联合反对。但今年频发的无人机扰航事件让形势变得严峻，该“管理要求”的出台只是时间问题。', '1', '2017-05-27 10:43:22', '2017-06-13 14:59:55', '1');
INSERT INTO `article_newbie` VALUES ('8', '1', '34536535', '司机与乘客高谈阔论?', '<p>2016年，《民用无人驾驶航空器系统适航管理要求（暂行）》发布征求意见稿，其中已规定，民用无人驾驶航空器最大起飞重量大于250克的民用无人驾驶航空器需按照特殊类、限制类、标准类的分类方式，申请相应的适航证件。<br/><br/></p><p style=\"text-align:center\"><img src=\"http://aps.com/data/upload/20170613/201706131608233245.jpg\" title=\"\" alt=\"\" width=\"341\" height=\"151\"/></p><p>上述“管理要求”至今尚未出台。专门从事飞行器研发和生产的深圳市莲花百川科技有限公司董事长严劲松告诉澎湃新闻，原因是无人机生产企业意见较大，“突然增加一道工作，都不想被管”，他透露，去年这份管理要求意见稿征求意见阶段，全国只有两家企业表示支持，200多家无人机及时相关企业联合反对。但今年频发的无人机扰航事件让形势变得严峻，该“管理要求”的出台只是时间问题。<br/></p>', '1', '2017-05-27 10:43:22', '2017-06-13 16:08:52', '0');
INSERT INTO `article_newbie` VALUES ('9', '5', '78907578', '路上停车大家围观?', '重奖“黑飞”举报人、严打净空区违法飞行、火速上线无人机实名登记系统、发布民用机场净空区域图……频发的无人机干扰民航飞行安全事件背后，一系列针对无人机的监管举措，正在紧锣密鼓制定中。\r\n2015年12月29日，中国民航局飞行标准司印发了《轻小无人机运行规定》（试行），因为是部门规章，约束力不足。\r\n多位参与征求意见的专家透露，该法规可能是目前针对无人机监管最全面的规定，不仅对无人机拥有者合法飞行指明了方向，也对无人机生产企业的生产提出新的要求，并对“黑飞”行为的处罚作出了明确规定。\r\n参与征求意见的王勇（化名）表示，该规定目前处于征求意见阶段，一些条文可能还会改动，但大体思路应该不会变动，即从生产到销售，以及拥有者的使用，都将依法可依。\r\n他还分析，由于近期无人机监管形势严峻，各方压力都很大，该“管理规定”可能很快就会出台。\r\n王勇介绍，目前正在征求意见的管理规定明确，今后将在无人机生产过程中，推行适航审定制度。如民用无人驾驶航空器未按规定取得适航证书而飞行，将被责令停止飞行，处以10万元以上50万元以下的罚款。\r\n“达到打击违规、清理乱象、正规秩序的目的”\r\n澎湃新闻注意到，上述“整治方案”部署了明确的工作进度，在宏观思路和具体手段上，都提出了要求，并设定了整治工作需要达到的目标。这为后来一系列具体法规和举措的出台，埋下了伏笔。\r\n按“整治方案”部署的要求，这项工作分抽查摸底、集中整治和总结评估三个阶段。完成时间分别为5月底、7月底前和8月底前。目前进行的无人机实名登记，即属于抽查摸底阶段的工作之一。\r\n在集中整治阶段，将加强无人机数量分布集中地区和“黑飞”高发地，以及首都地区、机场周边、重要设施和敏感地区的违法飞行的监控处置和处罚，“达到打击违规、清理乱象、正规秩序的目的”。\r\n在效果评估阶段，空管委将汇总各地整治情况报告，视情况推广有益做法，研究建立健全无人驾驶航空器长效管理机制的措施。\r\n值得一提的是，“整治方案”还给出了较为细致的实施措施。比如，对本地区无人航空器爱好者的情况，有关部门要持续跟踪，对重点人员要不定期走访，增大巡查力度，形成高压态势。\r\n成都和重庆多位无人机爱好者均表示，近期辖区民警到家里来调查，并做了笔录。重庆一位无人机爱好者称，不久前有人半夜敲门，开门才知是民警来询问近期放飞无人机的情况。\r\n此外，对于重点区域的监控、如何规范运行、无人机企业产品的管理、宣传教育和长效机制的建立方面，“整治方案”都给出了方向性的意见。\r\n无人机从图纸设计到生产结束都要监控之中\r\n“整治方案”是紧急情况下的治标之举，而治本则有赖于建立一套能够规范无人机使用的长效机制：除了已经发布的实名制登记规定，无人机的飞行管理规定也在酝酿中。\r\n王勇介绍，目前正在征求意见的无人驾驶航空器飞行管理规定（下称无人机飞行管理规定），对无人机生产企业和监管部门的工作，提出了更高更细的要求。\r\n无人机飞行管理规定明确，今后将在无人机生产过程中，推行适航审定制度。\r\n适航证由适航部门根据民用航空器产品和零件合格审定规定，对民用航空器颁发的证明其处于安全可用状态的证件。\r\n通俗地说，即在一架无人机从图纸设计到生产结束，整个过程都应该纳入民航局试航司的监控之中，以确保每个步骤可追溯。适航监察员对申请适航证的航空器的适航检查，在航空器是设计、制造、组装或者改装现场进行。\r\n适航审定制度是确保飞机的安全性能的重要保障。目前，只有“有人机”和一些需要在航路上飞行的无人机，进行了适航审定。一般消费机无人机，并没有纳入适航审定。\r\n2016年，《民用无人驾驶航空器系统适航管理要求（暂行）》发布征求意见稿，其中已规定，民用无人驾驶航空器最大起飞重量大于250克的民用无人驾驶航空器需按照特殊类、限制类、标准类的分类方式，申请相应的适航证件。\r\n上述“管理要求”至今尚未出台。专门从事飞行器研发和生产的深圳市莲花百川科技有限公司董事长严劲松告诉澎湃新闻，原因是无人机生产企业意见较大，“突然增加一道工作，都不想被管”，他透露，去年这份管理要求意见稿征求意见阶段，全国只有两家企业表示支持，200多家无人机及时相关企业联合反对。但今年频发的无人机扰航事件让形势变得严峻，该“管理要求”的出台只是时间问题。', '1', '2017-05-27 10:43:22', '2017-06-13 15:01:05', '1');
INSERT INTO `article_newbie` VALUES ('10', '5', '45646645', '新手上路开车，一定要有良好的开车心态?', '重奖“黑飞”举报人、严打净空区违法飞行、火速上线无人机实名登记系统、发布民用机场净空区域图……频发的无人机干扰民航飞行安全事件背后，一系列针对无人机的监管举措，正在紧锣密鼓制定中。\r\n2015年12月29日，中国民航局飞行标准司印发了《轻小无人机运行规定》（试行），因为是部门规章，约束力不足。\r\n多位参与征求意见的专家透露，该法规可能是目前针对无人机监管最全面的规定，不仅对无人机拥有者合法飞行指明了方向，也对无人机生产企业的生产提出新的要求，并对“黑飞”行为的处罚作出了明确规定。\r\n参与征求意见的王勇（化名）表示，该规定目前处于征求意见阶段，一些条文可能还会改动，但大体思路应该不会变动，即从生产到销售，以及拥有者的使用，都将依法可依。\r\n他还分析，由于近期无人机监管形势严峻，各方压力都很大，该“管理规定”可能很快就会出台。\r\n王勇介绍，目前正在征求意见的管理规定明确，今后将在无人机生产过程中，推行适航审定制度。如民用无人驾驶航空器未按规定取得适航证书而飞行，将被责令停止飞行，处以10万元以上50万元以下的罚款。\r\n“达到打击违规、清理乱象、正规秩序的目的”\r\n澎湃新闻注意到，上述“整治方案”部署了明确的工作进度，在宏观思路和具体手段上，都提出了要求，并设定了整治工作需要达到的目标。这为后来一系列具体法规和举措的出台，埋下了伏笔。\r\n按“整治方案”部署的要求，这项工作分抽查摸底、集中整治和总结评估三个阶段。完成时间分别为5月底、7月底前和8月底前。目前进行的无人机实名登记，即属于抽查摸底阶段的工作之一。\r\n在集中整治阶段，将加强无人机数量分布集中地区和“黑飞”高发地，以及首都地区、机场周边、重要设施和敏感地区的违法飞行的监控处置和处罚，“达到打击违规、清理乱象、正规秩序的目的”。\r\n在效果评估阶段，空管委将汇总各地整治情况报告，视情况推广有益做法，研究建立健全无人驾驶航空器长效管理机制的措施。\r\n值得一提的是，“整治方案”还给出了较为细致的实施措施。比如，对本地区无人航空器爱好者的情况，有关部门要持续跟踪，对重点人员要不定期走访，增大巡查力度，形成高压态势。\r\n成都和重庆多位无人机爱好者均表示，近期辖区民警到家里来调查，并做了笔录。重庆一位无人机爱好者称，不久前有人半夜敲门，开门才知是民警来询问近期放飞无人机的情况。\r\n此外，对于重点区域的监控、如何规范运行、无人机企业产品的管理、宣传教育和长效机制的建立方面，“整治方案”都给出了方向性的意见。\r\n无人机从图纸设计到生产结束都要监控之中\r\n“整治方案”是紧急情况下的治标之举，而治本则有赖于建立一套能够规范无人机使用的长效机制：除了已经发布的实名制登记规定，无人机的飞行管理规定也在酝酿中。\r\n王勇介绍，目前正在征求意见的无人驾驶航空器飞行管理规定（下称无人机飞行管理规定），对无人机生产企业和监管部门的工作，提出了更高更细的要求。\r\n无人机飞行管理规定明确，今后将在无人机生产过程中，推行适航审定制度。\r\n适航证由适航部门根据民用航空器产品和零件合格审定规定，对民用航空器颁发的证明其处于安全可用状态的证件。\r\n通俗地说，即在一架无人机从图纸设计到生产结束，整个过程都应该纳入民航局试航司的监控之中，以确保每个步骤可追溯。适航监察员对申请适航证的航空器的适航检查，在航空器是设计、制造、组装或者改装现场进行。\r\n适航审定制度是确保飞机的安全性能的重要保障。目前，只有“有人机”和一些需要在航路上飞行的无人机，进行了适航审定。一般消费机无人机，并没有纳入适航审定。\r\n2016年，《民用无人驾驶航空器系统适航管理要求（暂行）》发布征求意见稿，其中已规定，民用无人驾驶航空器最大起飞重量大于250克的民用无人驾驶航空器需按照特殊类、限制类、标准类的分类方式，申请相应的适航证件。\r\n上述“管理要求”至今尚未出台。专门从事飞行器研发和生产的深圳市莲花百川科技有限公司董事长严劲松告诉澎湃新闻，原因是无人机生产企业意见较大，“突然增加一道工作，都不想被管”，他透露，去年这份管理要求意见稿征求意见阶段，全国只有两家企业表示支持，200多家无人机及时相关企业联合反对。但今年频发的无人机扰航事件让形势变得严峻，该“管理要求”的出台只是时间问题。', '1', '0000-00-00 00:00:00', '2017-06-13 15:00:57', '1');
