INSERT INTO `article_news` VALUES ('1', '1', '436465', '汽车灯光全扫描:不只有远光灯才讨人厌', '/data/upload/test_img/QQ截图20170516112021.jpg', '<p>【PConline 杂谈】汽车灯光是老生常谈的话题了，鉴于早前《汽车玻璃全扫面》一文获得不少认可，所以今天我们来聊聊汽车灯光。汽车不同灯光的使用场景不尽相同，即便是开车很久的老司机也未必能正确使用所有灯光，反而有些时候恰恰由于所谓“常识”而祸害他人。<br/><br/>　　接下来你将看到以下信息：<br/><br/><br/><br/> 　　1| 汽车灯的演变史；<br/><br/> 　　2| 汽车灯的种类与应用场景；<br/><br/> 　　3| 汽车灯光的信息化趋势；<br/></p>', '1', '2017-05-16 14:16:52', '2017-06-13 16:06:26', '0');
