INSERT INTO `article_news` VALUES ('2', '4', '456466', '勒索病毒入侵 竟导致这两家汽车工厂停工', '/data/upload/test_img/QQ截图20170516111947.jpg', '【PConline 资讯】法国当地时间5月13日，雷诺汽车表示其计算机系统遭到目前臭名昭著的网络勒索病毒攻击，旗下几个工厂已经暂时停工。\r\n\r\n　　当地时间5月13日，雷诺位于法国桑杜维尔和斯洛文尼亚新梅斯托的工厂的生产工作都已经暂停，两家工厂主要生产包括雷诺Twingo、Clio和Trafic。不过由于正处周末，法国工厂并没有处于产能全开的状态，所以病毒带来的影响较小。而斯洛文尼亚的工厂则是主动停产以“避避风头”，等到病毒得到有效控制后再恢复生产。\r\n\r\n雷诺Clio\r\n雷诺Clio\r\n\r\n　　而雷诺的日本盟友可就没这么幸运了。日产汽车在英国桑德兰的工厂就受到了该病毒的攻击，好几个系统受到牵连，据当地媒体报道这家工厂已经停工。桑德兰的这家工厂体量挺大，拥有7000名员工，病毒攻击前正在生产包括日产聆风、逍客和英菲尼迪Q30等等车型。\r\n\r\n日产聆风\r\n日产聆风\r\n\r\n　　编辑点评：此次网络勒索病毒的攻击范围极广，涵盖了全球范围内的多数计算机。而攻击汽车工厂的话，有点黑道大哥收保护费才允许继续生产的意思。', '1', '2017-05-16 14:17:00', '2017-06-13 14:16:45', '0');
INSERT INTO `article_news` VALUES ('3', '3', '345664', '念叨那么久 VVT-i和i-VTEC究竟有啥区别?', '/data/upload/test_img/QQ截图20170516135505.jpg', '【PConline 杂谈】“我的卡罗拉有VVT-i，可变气门正时系统能根据实际情况调节气门正时位置，提高动力表现哈哈哈。”\r\n\r\n　　“噢，可是我的思域有i-VTEC，除了可变气门正时外还能升程，你跟我比？”\r\n\r\n　　都说本田大法好，丰田就真的比不上么？来看看这两家的看家法宝究竟是什么。\r\n\r\n1\r\n\r\n　　不过首先，我们先来看看什么是奥拓循环和阿特金森循环。\r\n\r\n　　目前绝大多数的汽油发动机都是奥拓循环，由德国工程师尼古拉斯·奥拓于1876年发明的基于此循环的内燃机，并且申请了专利。\r\n\r\n典型的奥拓循环示意图\r\n典型的奥拓循环示意图\r\n\r\n　　不过，发动机的动力很快就达到一个相对的极限，想要继续压榨动力的话就得用新的技术。除了现在常见的涡轮增压、机械增压外，另一个能够显著提高燃油利用率的就是提高发动机的压缩比。\r\n\r\n　　什么是压缩比呢？简单的理解就是压缩过程中，气缸的最大体积和最小体积之比，也就是活塞在压缩前到达最低点时活塞上方气缸体积和压缩过程中活塞到达最高点时活塞上方气缸体积的比值。\r\n\r\n　　而膨胀比就是在做功时，活塞运动时气缸最大体积和最小体积之比啦。\r\n\r\n1\r\n\r\n　　奥拓循环中，压缩比等于膨胀比。\r\n\r\n　　如果膨胀比大于压缩比，意味着燃料燃烧后气体的膨胀做功将更加完全，燃烧效率更大。而这个就是阿特金森循环的精髓所在。但是早期的阿特金森循环采用的机械结构非常复杂，制造成本和难度都很高，更别说常规的发动机维护。\r\n\r\n　　而目前的阿特金森循环则采用电力控制，推迟进气门的关闭时间，在活塞压缩的过程中有部分油气从进气口中排出，通过减少进气量来达到膨胀比大于压缩比的目的。\r\n\r\n　　简单地说，阿特金森循环的膨胀比大于压缩比，燃油经济性更好。但是由于是通过减少进气量来达到这个效果，所以发动机并没有全力输出。\r\n\r\n什么是VVT-i？\r\n\r\n　　常规发动机中，气门由凸轮轴带动，进排气门的时间都是固定的。固定的进排气节奏在一定条件下其实阻碍了发动机效率的提升，毕竟发动机所需的空气，以及需要排出的气体并不是随转速(凸轮轴)的改变而同步改变的。\r\n\r\n1\r\n\r\n　　不懂的话，想想你跑步的时候，急促的呼吸和过慢的呼吸都会导致自己身体的舒适度下降。在长跑的不同阶段，我们需要调整相应的呼吸频率来迎合身体对于氧气的需求。而对于汽车发动机而言，进气的多少同样取决于发动机实际的需求。如果能够根据发动机的需求来调节进气量，那将直接提升动力表现和燃料的燃烧效率。\r\n\r\n　　发动机处在较低转速时，不需要过多的气体进入，排气的时候也不需要太长的时间。太长的排气时间反而可能会导致发动机反向吸入废气，更加影响效率。而在较高转速时，发动机一个工作冲程仅仅需要千分之几秒，进气不足、排气不净的问题会直接导致发动机效率的降低。\r\n\r\n1\r\n\r\n　　VVT全名为可变气门正时(Variable Valve Timing)。在ECU中存储有不同状况下气门的最佳参数，而ECU从发动机各个部位的传感器中获取发动机的实时参数，包括转速、进气量、节气门位置等等，对应存储的数据，通过控制凸轮轴正时液压控制阀来执行反馈控制，控制气门的开启和关闭时间来匹配发动机的最佳工作状态，减少耗油量和废气排放，并且提高发动机的工作效率。\r\n\r\n　　而VVT-i其实就是多了个智能(intelligent)。发动机由低速向高速转换时，ECU自动将机油压向进气凸轮轴驱动齿轮内的小涡轮，使其旋转一定的角度，控制凸轮轴在60度的范围内前后旋转，改变进气门开启的时刻。由于机油量的增减是连续的，所以气门开启关闭的角度调节也是连续的。\r\n\r\n　　一般说的VVT-i只调节进气的时间长短。而双VVT-i则同时调节进、排气的时间。\r\n\r\n什么是i-VTEC？\r\n\r\n　　首先，VTEC全称“Variable Valve Timing and Lift Electronic Control”。除了VVT-i上有的可调节气门开闭时间之外，由于在同一根凸轮轴上有两三种不同角度的凸轮，使得在不同的转速区有着对应不同的凸轮的使用。凸轮的种类不同直接使得气门开启的幅度不同(进气量的不同)，这好比就是一扇窗，VVT只控制窗的开启时间，而VTEC则同时控制着窗的开启时间和开启的幅度。\r\n\r\n左下角的就是VTEC介入前，右上角则是VTEC介入\r\n左下角的就是VTEC介入前，右上角是VTEC介入后\r\n\r\n　　简单地说，同一根凸轮轴上的不同凸轮，在转速达到一定程度后，电磁阀激活，不同凸轮轴吸附在一起，作用的变成了更凸的那个轮轴。而在低转速时，电磁阀关闭，作用的则是没那么凸的轮轴。凸轮轴的这个“凸”的程度，决定的就是气门开启的幅度。\r\n\r\n1\r\n\r\n　　不过由于高低凸轮轴的不同，使得VTEC的介入非常突然，这也是众多视频中，采用了VTEC技术的本田在达到某个转速后动力提升非常明显，要是改装后马力大幅度提升，VTEC的存在简直就是“没有如蜗牛，有了窜天猴”。\r\n\r\n\r\n\r\n　　所以在此基础上，本田的i-VTEC则能够连续改变凸轮轴的结合角度，使得气门开启的角度变化更加平缓，不会再有“背后被人踹一脚”的感觉。\r\n\r\n为什么前面要说到阿特金森循环？\r\n\r\n　　因为最新的丰田VVT-iw，后缀的w意味着wide，也就是更宽的调节角度，达到了-30—50度的调节范围。由于凸轮轴加入了锁止装置，使得其能够固定在某个角度进行气门的开闭，能够固定延长气门的关闭时间，随着活塞到达最低点后的压缩，部分气体从进气口排出，制造出阿特金森循环的效果。\r\n\r\n　　这套系统主要用于目前的皇冠2.0T车型和卡罗拉的1.2T车型，使得小排量发动机“省油的时候开阿特金森，要马力的时候气门全开，进气量给你最充足”。', '1', '2017-05-16 14:17:03', '2017-06-13 14:16:43', '0');
INSERT INTO `article_news` VALUES ('4', '2', '345646', '比亚迪向美国交付了18米铰链式电动大巴', '/data/upload/test_img/QQ截图20170516135513.jpg', '【PConline 资讯】近日，比亚迪在北美亮相了首台纯电动环卫卡车，与此同时，比亚迪正式向北美市场交付全球首台18米长的纯电动铰链式大巴，注意哦，是全球首台！\r\n\r\n　　客户方为美国加州羚羊谷交通运输局AVTA (Antelope Valley Transit Authority)，在2016年2月与比亚迪达成订单，向比亚迪购买85台纯电动大巴，其中，包含了13台18米长的纯电动铰链式大巴，它想以此实现车队2018年全面电动化，从而成为北美首支100%电动大巴车队。\r\n\r\n比亚迪 \r\n首台交付AVTA的纯电动铰链式大巴，将帮助该公司打造100%纯电动化车队\r\n\r\n　　根据比亚迪官方资料显示：截至目前，比亚迪纯电动大巴、卡车及出租车足迹已遍布美国东西两岸，包括田纳西、马里兰、德克萨斯、密苏里和加利福利亚等30多个州。其兰卡斯特工厂目前已聘用约570名当地员工，年产350台大巴/卡车，随着业务的不断发展壮大，年产能将增至1500台，并将继续创造上千个就业岗位。\r\n\r\n　　编辑点评：近日大家的民族自豪感可谓是满满的，先是国产航母下水，后有中国大飞机C919首飞，比亚迪这小小电动车亦是大步地跨进北美市场，你觉得自豪吗？看好这事吗？', '1', '2017-05-16 14:17:06', '2017-06-13 14:16:42', '0');
