INSERT INTO `base_ini` VALUES ('9', '公司简介', '<p>中兴通讯是全球领先的综合通信解决方案提供商。公司通过为全球160多个国家和地区的电信运营商和企业网客户提供创新技术与产品解决方案，让全世界用户享有语音、数据、多媒体、无线宽带等全方位沟通。公司成立于1985年，在香港和深圳两地上市，是中国最大的通信设备上市公司。<br/><br/></p><p style=\"text-align:center\"><img src=\"http://aps.com/data/upload/20170613/201706131626115679.png\" title=\"\" alt=\"\"/></p><p>　　未来，中兴通讯将继续致力于引领全球通信产业的发展，应对全球通信领域更趋日新月异的挑战。<br/></p>', null, '2017-06-13 16:26:21');
